        <div >
             <img src={hs2} className={style.hs2}>
             </img>
             <h1>홍시</h1>
                나이 : 3년 6개월 
                성별 : 여자
                특징 : 귀여움
                몸무게 : 비밀
            
         </div> )
}
         

    export default Write ;
